PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_keycloak_client" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "client_id" varchar(255) NOT NULL, "secret" varchar(255) NOT NULL, "realm_id" integer NOT NULL UNIQUE REFERENCES "django_keycloak_realm" ("id") DEFERRABLE INITIALLY DEFERRED, "service_account_profile_id" integer NULL UNIQUE REFERENCES "django_keycloak_openidconnectprofile" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_keycloak_exchangedtoken" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "access_token" text NULL, "expires_before" datetime NULL, "refresh_token" text NULL, "refresh_expires_before" datetime NULL, "oidc_profile_id" integer NOT NULL REFERENCES "django_keycloak_openidconnectprofile" ("id") DEFERRABLE INITIALLY DEFERRED, "remote_client_id" integer NOT NULL REFERENCES "django_keycloak_remoteclient" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_keycloak_nonce" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "state" char(32) NOT NULL UNIQUE, "redirect_uri" varchar(255) NOT NULL, "next_path" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "django_keycloak_openidconnectprofile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "access_token" text NULL, "expires_before" datetime NULL, "refresh_token" text NULL, "refresh_expires_before" datetime NULL, "sub" varchar(255) NOT NULL UNIQUE, "realm_id" integer NOT NULL REFERENCES "django_keycloak_realm" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_keycloak_realm" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL UNIQUE, "_certs" text NOT NULL, "_well_known_oidc" text NOT NULL, "server_id" integer NOT NULL REFERENCES "django_keycloak_server" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_keycloak_remoteclient" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "realm_id" bigint NOT NULL REFERENCES "django_keycloak_realm" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_keycloak_role" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "reference" varchar(50) NOT NULL, "client_id" bigint NOT NULL REFERENCES "django_keycloak_client" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_keycloak_server" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "url" varchar(255) NOT NULL, "internal_url" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "demo_diakoph" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "first_name" varchar(255) NOT NULL, "last_name" varchar(255) NOT NULL, "email" varchar(255) NOT NULL, "aithsh_id" varchar(255) NOT NULL, "reason" varchar(355) NOT NULL, "status" varchar(255) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "formFile" varchar(100) NOT NULL);
