CREATE TABLE IF NOT EXISTS "demo_aithsh" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "first_name" varchar(255) NOT NULL, "last_name" varchar(255) NOT NULL, "email" varchar(255) NOT NULL, "katatajh" varchar(255) NOT NULL, "education_level" varchar(255) NOT NULL, "communication" varchar(255) NOT NULL, "status" varchar(255) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "age" varchar(255) NOT NULL, "formFile" varchar(100) NOT NULL, "military_id" varchar(255) NOT NULL, "nomos_stratopedou" varchar(255) NOT NULL, "number_stratopedou" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "demo_apografh" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "first_name" varchar(255) NOT NULL, "last_name" varchar(255) NOT NULL, "email" varchar(255) NOT NULL, "father_name" varchar(255) NOT NULL, "mother_name" varchar(255) NOT NULL, "id_number" varchar(255) NOT NULL, "AFM" varchar(255) NOT NULL, "nomos" varchar(255) NOT NULL, "perioxh" varchar(255) NOT NULL, "odos" varchar(255) NOT NULL, "aithsh_id" varchar(255) NOT NULL, "height" varchar(255) NOT NULL, "weight" varchar(255) NOT NULL, "katatajh" varchar(255) NOT NULL, "education_level" varchar(255) NOT NULL, "communication" varchar(255) NOT NULL, "formFile" varchar(100) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "status" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "demo_myroles" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "useremail" varchar(255) NOT NULL, "userrole" varchar(255) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
